m/purchase/event/1382240?utm_medium=api","ticketPrice":"$12.00 - $14.00","externalTicketingUrls":[],"multiEventCartable":true,"facebookEventId":"","facebookEventIdString":"","headliners":[{"id":1769847,"name":"Laura Burhenn (of The Mynabirds)","startTime":null,"eventDescription":"American singer-songwriter Laura Burhenn is a shape-shifter who can't sit still. Since 2010 she's worked under the moniker The Mynabirds, releasing three critically acclaimed and stylistically different albums on Saddle Creek: What We Lose in the Fire We Gain in the Flood (2010) and GENERALS (2012), both produced by Richard Swift, and Lovers Know (2015). She has also toured as a member of the Postal Service (2013) and Bright Eyes (2011), helped found Omaha Girls Rock (a non-profit helping young girls find their voices), and in 2013 gave a TED talk based on her "New Revolutionists" portrait project, exploring what it means to be a revolutionary woman in this day and age. Before the Mynabirds, Laura was a member of DC indie band Georgie James with Q And Not U's John Davis, and also put out two self-produced solo albums on the label she founded herself, Laboratory Records.
Through all of her transformations, there's one thing that remains constant: her voice. She's been compared to Cat Power, Fiona Apple and Adele. And while her songs might show up dressed in new ways on each new release, they still very much embody Laura's distinct songwriting style. "I've always been most inspired by the songwriter chameleons," Laura says. "David Bowie, Harry Nilsson, PJ Harvey, Bjork. They play — with their arrangements, their tones, their personas. But when it comes down to it, every song could be strummed on guitar, or played alone at a keyboard. And at the heart of it, they're storytellers." Laura is setting out on a full US solo tour this fall, stripping all of her songs back to bare bones, the way they were originally conceived: just a piano and her voice.

